import styled from 'styled-components';
export const HTMLMulti = styled.div ``;
export const HTMLMultiPopup = styled.div `
  display: flex;
  align-items: center;
`;
export const HTMLMultiLabel = styled.div `
  border-bottom: 1px solid #d7d7d7;
  padding: 13px 10px 13px 0;
  margin-right: 3px;
  flex: 1;
`;
export const HTMLMultiHeader = styled.div ``;
export const HTMLMultiPopupTitle = styled.h2 `
  color: #4d4d4f;
  font-weight: 300;
  font-size: 24px;
  text-align: center;
  font-family: 'Roboto', 'Arial', 'Helvetica Neue';
`;
export const HTMLMultiBody = styled.div `
  padding: 12px 0;
  display: flex;
  flex-direction: column;
  align-items: center;
`;
export const HTMLMultiSectionTitle = styled.div `
  font-size: 20px;
  font-weight: 300;
  padding-bottom: 12px;
  color: #212122;
  text-align: center;
`;
export const HTMLMultiSection = styled.div `
  width: 100%;
  padding: 16px 0;
  margin: 16px 0;
  display: flex;
  flex-direction: column;
  align-items: center;
  border-top: 1px solid;
  border-color: #d7d7d7;
`;
//# sourceMappingURL=schema.multi.styled.js.map
